import homeimg from '../Images/homeimg.png';
import {NavLink} from 'react-router-dom';
import '../Css/ServiceStyle.css';

const Services=()=>{
    return(
        <>
        <h1>Our Services</h1><br></br>
        <div className="services">
        </div>
        </>
    )
}
export default Services;
